import React from 'react';

const ImageSlide = ({ url, title, cinema, date  }) => {
  const styles = {
    backgroundImage: `url(${url})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  };

  const { className, ...rest } = this.props;
  const childClassNames = classNames('child-class', className);

  return (
    <div 
    className={childClassNames} {...rest}
    // className="image-slide" 
    style={styles}
    title={title}
   	cinema={cinema}
   	date={date}   
	>
		<div className="inset-text">
		<h2 className="inset-text-title">{title}</h2>
		<h2 className="inset-text-cinema">{cinema}</h2>
		<h2 className="inset-text-date">{date}</h2>
		</div>
 	</div>
  );
}

export default ImageSlide;
